import React,{useState} from 'react'
import StripeCheckout from 'react-stripe-checkout'




function App() {
  const [product, setProduct] = useState({
    name: 'React from FB',
    price: 10,
    productBy: 'Facebook'
  })

  return (
   <>
    <h1>App</h1>
    <StripeCheckout
      stripeKey= {ProcessingInstruction.env.REACT_APP_KEY}
      token=""
      name="Buy React"
    >
      <button className="btn-large pink">Buy React in Just {product.price}$</button>
    </StripeCheckout>
   </>
  );
}

export default App;
